import React from "react";
import images from "../utilities/images";
import Card from "../Card";

const Gallery = ({ page }) => {
  console.log("from gallery", page);
  console.log(images.page);
  return <Card src={`../images/${page}/${image}`} />;
};

export default Gallery;
